class ProjectBox extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            datalines:Array(10).fill(''),
            datas:Array(10).fill(''),
            test:'testname',
            value:'',
            value2:'',
            count:0,
            output:'',
            open:false
        }
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.handleChange2 = this.handleChange2.bind(this);
    }

    handleClickOpen(){
        this.setState({open:true})
    }
    handleClose(){
        this.setState({open:false})
    }


    handleChange(event) {
        this.setState({value: event.target.value});
    }

    handleChange2(event) {
        this.setState({value2: event.target.value});
    }

    handleSubmit(event) {
        this.setState({output: this.state.value })
        event.preventDefault();
        let newarray=this.state.datalines
        let newarray2=this.state.datas
        let prevcount=this.state.count
        newarray[this.state.count]=this.state.value
        newarray2[this.state.count]=this.state.value2
        this.setState({
            count:prevcount+1,
            datalines:newarray,
            datas:newarray2,
            value:'',
            value2:''
        })
        this.handleClose()
    }
    resetdatalines(){
        this.setState({
            datalines:Array(),
            count:0
        })
    }
    emptydataline(i){
        let datalinesnew=this.state.datalines
        datalinesnew[i]=null
        this.setState({
            datalines:datalinesnew,
        })
        this.reorderdatalines(i)
        this.renderdatalines()
    }
    reorderdatalines(i){
        let datalinesnew=this.state.datalines
        let datacnt=this.state.count
        if(i>=datacnt)
            return
        for(let j=i;j<datacnt;j++){
            datalinesnew[j]=datalinesnew[j+1]
        }
        this.setState({
            datalines: datalinesnew,
            count:datacnt-1
        })
    }
    updataline(i){
        let datalinesnew=this.state.datalines
        let buffer=datalinesnew[i-1]
        if(i===0)
            return
        datalinesnew[i-1]=datalinesnew[i]
        datalinesnew[i]=buffer
        this.setState({
            datalines:datalinesnew
        })
    }
    downdataline(i){
        let datalinesnew=this.state.datalines
        let buffer=datalinesnew[i+1]
        if(i===6 || this.state.count<=i+1 || datalinesnew[i-1]===null)
            return
        datalinesnew[i+1]=datalinesnew[i]
        datalinesnew[i]=buffer
        this.setState({
            datalines:datalinesnew
        })
    }

    renderdatalines(){
        let datalinesrender=[]
        for(let i=0; i<this.state.count; i++){
            datalinesrender.push(
                <div className="margin">
                    <Card sx={{maxWidth:300}}>
                        <CardContent>
                            <Typography>
                                Név:{this.state.datalines[i]}
                            </Typography>
                            <Typography>
                                Leírás:{this.state.datas[i]}
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button startIcon={<ArrowUpwardIcon/>} onClick={()=>this.updataline(i)}/>
                            <Button startIcon={<ArrowDownwardIcon/>} onClick={()=>this.downdataline(i)} />
                            <Button startIcon={<DeleteIcon/>} onClick={() => this.emptydataline(i)}/>
                        </CardActions>
                    </Card>
                </div>
            )
        }
        return datalinesrender
    }
    render() {

        return (
            <Box>
                <Button sx={{width:300}} startIcon={<AddCircleIcon/>} onClick={()=>this.handleClickOpen()}/>
                <Dialog open={this.state.open} sx={{width:1500}}>
                    <DialogTitle>Add a Task</DialogTitle>
                    <DialogContentText>To add a new Task please fill the fields below</DialogContentText>
                    <form onSubmit={this.handleSubmit}>
                        <label>
                            Task:
                            <TextField required type="text" value={this.state.value} onChange={this.handleChange} />
                            Description:
                            <TextField type="text" value={this.state.value2} onChange={this.handleChange2} />
                        </label>
                        <div> <Button onClick={()=>this.handleClose()}>Cancel</Button><Button type="submit" variant="text" value="Submit">Add</Button></div>
                    </form>
                </Dialog>
                {this.renderdatalines()}
            </Box>
        );
    }
}

